const ProfileCard = (props) => {
    const handleData = (e) => {
        e.preventDefault();
    }

    const [prevProps, setProps] = useState(null);

    if(props !== prevProps){
        setProps(props);

    }

    return (
        <div className="container">
            <div className="title">
                <h1>{props.title}</h1>
            </div>
            <div className="image">
                <img src={props.image} alt="Profile"/>
            </div>
            <div className="content">

            </div>
        </div>
    );
}

export default ProfileCard;
